circuits.ibm_Z:
OPENQASM 2.0;
include "qelib1.inc";
qreg q[2];
creg c[2];

// Prepare |01> (Hartree-Fock state)
x q[1];

// UCCSD ansatz
cx q[1], q[0];
ry(1.441311) q[0];
cx q[1], q[0];

measure q[0] -> c[0];
measure q[1] -> c[1];

